import './App.css';

function App() {
  return (
    <div className="App">
      <h1>Welcome to the Library</h1>
      <button onClick={TicTacToe}>Tic-Tac-Toe</button>
      <button onClick={CardGame}>Card Dealer</button>
    </div>
  );
}

export default App;
